import GridElement from './gridelement'
import Data from '../content/data.json'

export default class Grid extends Component {
	render() {
		return (
			<section class="tiles">
				{Data.map(e => {
					return (
						<div>
						e.title
						</div>
						)
				})}
			</section>
		)
	}
}
